"use strict";var User=function(e,t,r){this.name=e,this.email=t,this.birthday=r};User.prototype.toString=function(){var e=document.querySelector("header"),t=this.getMyAge();e.innerHTML="\n            <h1>Hi, my name is "+this.name+". I'm "+t+' years old</h1>\n            <a href="mailto:'+this.email+'">'+this.email+"</a>\n        "},User.prototype.getMyAge=function(){return(new Date).getFullYear()-new Date(this.birthday).getFullYear()};var user=new User("Mauro Vieira","mauroreisvieira@gmail.com","01-06-1990");user.toString();